export const Todo = (p) => {
    return (
        <ul >
  <li>{p.td}</li>
  <li >{p.ap}</li>
  <li >{p.ma}</li>
  <li >{p.ki}</li>
  <li >{p.or}</li>


</ul>


    );
}


export const Oodo = (p) => {
    return (
        <ul >
  <li>{p.t}</li>
  <li >{p.a}</li>
  <li >{p.m}</li>
  <li >{p.k}</li>
  <li >{p.o}</li>


</ul>


    );
}
